			shellScript = "# shell script goes here\n# to use it please install Xcode 2.5 (in parallel to Xcode 3.x)\n\ncd Panels\n\nNIBTOOL=/Xcode2.5/usr/bin/nibtool\n\nNIBS=$(cd English.lproj; echo *.nib)\n\nfor NIB in $NIBS\n\tdo\n\techo \"Processing $NIB\"\n\tfor i in *.lproj\n\t\tdo\n\t\techo \"Language $i\"\n\t\tif [ ! \"$i\" = \"English.lproj\" ]\n\t\t\tthen\n\t\t\tif [ ! -x \"$i/$NIB\" ]\n\t\t\t\tthen\n\t\t\t\techo \"Creating $i/$NIB\"\n\t\t\t\tcp -R \"English.lproj/$NIB\" \"$i/\"\n\t\t\tfi\n\t\t\tif [ ! -r \"$i/$NIB.strings\" ]\n\t\t\t\tthen\n\t\t\t\techo \"Creating $i/$NIB.strings\"\n\t\t\t\techo \"/* Please keep the left side completely unchanged!!! Just translate the right side of the equations.*/\" >\"$i/$NIB.strings\"\n\t\t\t\t$NIBTOOL --utf8 -I \"$i/$NIB\" -L \"English.lproj/$NIB\" >>\"$i/$NIB.strings\"\n\t\t\tfi\n\t\t\techo \"Updating $i/$NIB\"\n\t\t\t$NIBTOOL --utf8 -I \"English.lproj/$NIB\" -W \"$i/$NIB.tmp\" -d \"$i/$NIB.strings\" \"English.lproj/$NIB\"\n\t\t\tcp \"$i/$NIB.tmp\"/* \"$i/$NIB\"\t\t# keep .svn intact\n\t\t\ttouch \"$i/$NIB\"\t\t# make changes known to Xcode\n\t\t\trm -rf \"$i/$NIB.tmp\"\n\t\telse\n\t\t\techo not touched\n\t\tfi\n\t\techo\n\tdone\n\techo\ndone\n";
